import React from "react";
import Cards from "./Cards";

const CardList = ({ robots }) => {
  if (true) {
    throw new Error("Nooooo!");
  }
  return (
    <div>
      {robots.map((user, i) => {
        return (
          <Cards
            key={i}
            id={robots[i].id}
            name={robots[i].name}
            email={robots[i].email}
          />
        );
      })}
    </div>
  );
};

export default CardList;
